kice. Zatim u dublji tiganj staviti mleveno meso i sipati ulje, pa to dinstati na srednjoj temperaturu mešajući oko 3-4 minuta, da se meso fino izdinsta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim dodati crni luk, posoliti i pobiberiti i nastaviti dinstati mešajući oko 5-10 minuta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uključiti rernu da se greje na 200 stepeni. Nakon toga pripremiti preliv od ulja i kisele vode, blago umutiti viljuškom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sada uzeti jedan dublji i veći okrugli pleh i na dno sipati 2 kašike ulja, pa ravnomerno namazati dno i ivice pleha.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prvo odvojiti sa strane 2 kore koje treba staviti na samom kraju pravljenja bureka. Na dno pleha prvo staviti 2 prazne kore i ostaviti da krajevi kore budu van pleha. Sada staviti oko 2-3 pune kašike mlevenog mesa i ravnomerno rasporediti u plehu. Meso sada preliti sa 4-5 kašika preliva i onda posle toga krajeve kore koje se bile van pleha staviti u pleh i blago pritisnuti. Tako nastaviti ređati sada po jednu koru, pa onda na svaku koru staviti meso i preliti sa prelivom, a krajeve kore ubaciti u pleh posle svake druge kore i pritisnuti blago.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na samom kraju staviti 2 prazne kore gore, saviti krajeve kore i staviti u pleh. Preliti sa ostatkom preliva, oko 1 dl i probosti sa čačkalicom burek na više mesta. Staviti burek da se peče. Peći na 200 stepeni oko 40 minuta, odnosno sve dok lepo ne porumeni i gornja kora ne bude hrskava.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Burek sa mesom poslužiti toplo uz salatu od pradajza, uz kiselo mleko, jogurt, ili po želji.</p>\n<!-- /wp:paragraph -->','Burek sa mesom','','publish','closed','closed','','burek-sa-mesom','','','2022-08-04 17:55:23','2022-08-04 17:55:23','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=251',0,'post','',0),(252,1,'2022-08-04 17:32:49','2022-08-04 17:32:49','','burek sa mesom','','inherit','open','closed','','burek-sa-mesom','','','2022-08-04 17:32:49','2022-08-04 17:32:49','',251,'https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek-sa-mesom.webp',0,'attachment','image/webp',0),(253,1,'2022-08-04 17:32:57','2022-08-04 17:32:57','<!-- wp:paragraph -->\n<p>Prvo oljuštiti crni luk i iseckati na sitnije kockice. Zatim u dublji tiganj staviti mleveno meso i sipati ulje, pa to dinstati na srednjoj temperaturu mešajući oko 3-4 minuta, da se meso fino izdinsta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim dodati crni luk, posoliti i pobiberiti i nastaviti dinstati mešajući oko 5-10 minuta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uključiti rernu da se greje na 200 stepeni. Nakon toga pripremiti preliv od ulja i kisele vode, blago umutiti viljuškom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sada uzeti jedan dublji i veći okrugli pleh i na dno sipati 2 kašike ulja, pa ravnomerno namazati dno i ivice pleha.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prvo odvojiti sa strane 2 kore koje treba staviti na samom kraju pravljenja bureka. Na dno pleha prvo staviti 2 prazne kore i ostaviti da krajevi kore budu van pleha. Sada staviti oko 2-3 pune kašike mlevenog mesa i ravnomerno rasporediti u plehu. Meso sada preliti sa 4-5 kašika preliva i onda posle toga krajeve kore koje se bile van pleha staviti u pleh i blago pritisnuti. Tako nastaviti ređati sada po jednu koru, pa onda na svaku koru staviti meso i preliti sa prelivom, a krajeve kore ubaciti u pleh posle svake druge kore i pritisnuti blago.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na samom kraju staviti 2 prazne kore gore, saviti krajeve kore i staviti u pleh. Preliti sa ostatkom preliva, oko 1 dl i probosti sa čačkalicom burek na više mesta. Staviti burek da se peče. Peći na 200 stepeni oko 40 minuta, odnosno sve dok lepo ne porumeni i gornja kora ne bude hrskava.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Burek sa mesom poslužiti toplo uz salatu od pradajza, uz kiselo mleko, jogurt, ili po želji.</p>\n<!-- /wp:paragraph -->','Burek sa mesom','','inherit','closed','closed','','251-revision-v1','','','2022-08-04 17:32:57','2022-08-04 17:32:57','',251,'https://afisic.wppsbootcamp.com/trpkovic/?p=253',0,'revision','',0),(255,1,'2022-08-04 17:35:45','2022-08-04 17:35:45','{\n    \"astra-settings[single-post-sidebar-layout]\": {\n        \"value\": \"no-sidebar\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:34:32\"\n    },\n    \"astra-settings[single-post-content-layout]\": {\n        \"value\": \"plain-container\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:34:43\"\n    },\n    \"astra-settings[blog-single-post-structure]\": {\n        \"value\": [\n            \"single-title-meta\",\n            \"single-image\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:34:56\"\n    },\n    \"astra-settings[blog-single-meta]\": {\n        \"value\": [\n            \"category\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:35:16\"\n    }\n}','','','trash','closed','closed','','41a1998e-8dd9-4b62-b393-d3e134818983','','','2022-08-04 17:35:45','2022-08-04 17:35:45','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=255',0,'customize_changeset','',0),(256,1,'2022-08-04 17:39:18','2022-08-04 17:39:18','{\n    \"astra-settings[enable-related-posts]\": {\n        \"value\": true,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:37:11\"\n    },\n    \"astra-settings[related-posts-title]\": {\n        \"value\": \"Povezani recepti\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:37:19\"\n    },\n    \"astra-settings[related-posts-meta-color]\": {\n        \"value\": \"#89001c\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:38:42\"\n    },\n    \"astra-settings[related-posts-meta-font-family]\": {\n        \"value\": \"Helvetica\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:38:42\"\n    }\n}','','','trash','closed','closed','','df05ea40-7c66-4675-b004-f516045594a5','','','2022-08-04 17:39:18','2022-08-04 17:39:18','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=256',0,'customize_changeset','',0),(257,1,'2022-08-04 17:40:41','2022-08-04 17:40:41','{\n    \"astra-settings[related-posts-meta-structure]\": {\n        \"value\": [\n            \"category\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:40:41\"\n    }\n}','','','trash','closed','closed','','b419812e-1d26-46f2-908d-8a19a19d6f74','','','2022-08-04 17:40:41','2022-08-04 17:40:41','',0,'https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/b419812e-1d26-46f2-908d-8a19a19d6f74/',0,'customize_changeset','',0),(258,1,'2022-08-04 17:44:37','2022-08-04 17:44:37','<!-- wp:paragraph -->\n<p>750 gr brašna prosejati, pa dodati so, promešati malo rukom, pa nalivati vodu i mesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Umesiti glatko testo. Potrebno je da se testo dobro izmesi.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podeliti na 5 jednakih delova, svaka loptica ima otprilike 250 gr.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Napraviti loptice pa pokriti kesom i krpom i ostaviti da odstoji 30 – 60 minuta. Nikako manje od 30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Za to vreme sitno iseckati luk, dodati mleveno meso, suvi začin i biber pa izmesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Otopiti puter sa uljem, na jakoj vatri. Kad provri skloniti sa vatre. Mora da provri da bi se maslo i ulje dobro sjedinili.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kad jufke odmore razvući svaku na prečnik otprilike 20 cm i svaku premazati sa 2 – 3 kašike otopljenog masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Slagati krugove jedan na drugi dok mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Stavite jedan premazeta pa drugi, tako do petog, peti ne mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pospite odgore brašnom, i stavite &nbsp;preko stola neko pletno, najbolje belo pamučno,&nbsp;pa i njega pospite sa malo brašna. Možete raditi i na stolu, ali vam onda treba više brašna, manje se lepi na tkaninu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste naslagali jedan krug na drugi i stavili na tkaninu ( dok stavljate već će početi da se razvlači). (slika)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Razvući oklagijom koliko možete a zatim i rukama do kraja stola.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste razvukli isecite deo koji visi sa stola, zadebljanje odstranite nožem ( krajeve ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na ivicu stavite celom dužinom 1/5 nadeva i malo isprskajte sa maslom i uljem ( slika ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uvijte jedan krug oko mesa pa isecite ( slika ), tako da sad imate tanku i dugačku rolnicu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tako uradite do kraja sa ostalim testom i mesom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim seckajte na dužinu 3 – 4 cm sve rolnice. Dobićete male jastučiće, meni tako bar izgledaju.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podmazati pleh prečnika 35 cm pa slagati u krug iseckane kvadratiće, jastučiće, kako hoćete pa premazati ih sa ostatkom masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dok motate rerna se greje na 250 stepeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada sve poslažete i premažete stavite da se peče dok ne porumeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na kraju kad je pečeno i kiselo mleko naseckajte belo luk i premažite preko vrelih mantija i ostavite 10 minuta poklopljeno drugom tepsijom da odstoji, pa poslužite posle 10 minuta.</p>\n<!-- /wp:paragraph -->','Mantije','','publish','closed','closed','','mantije','','','2022-08-04 17:55:19','2022-08-04 17:55:19','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=258',0,'post','',0),(259,1,'2022-08-04 17:44:24','2022-08-04 17:44:24','','mantije','','inherit','open','closed','','mantije','','','2022-08-04 17:44:24','2022-08-04 17:44:24','',258,'https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/mantije.webp',0,'attachment','image/webp',0),(260,1,'2022-08-04 17:44:37','2022-08-04 17:44:37','<!-- wp:paragraph -->\n<p>750 gr brašna prosejati, pa dodati so, promešati malo rukom, pa nalivati vodu i mesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Umesiti glatko testo. Potrebno je da se testo dobro izmesi.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podeliti na 5 jednakih delova, svaka loptica ima otprilike 250 gr.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Napraviti loptice pa pokriti kesom i krpom i ostaviti da odstoji 30 – 60 minuta. Nikako manje od 30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Za to vreme sitno iseckati luk, dodati mleveno meso, suvi začin i biber pa izmesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Otopiti puter sa uljem, na jakoj vatri. Kad provri skloniti sa vatre. Mora da provri da bi se maslo i ulje dobro sjedinili.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kad jufke odmore razvući svaku na prečnik otprilike 20 cm i svaku premazati sa 2 – 3 kašike otopljenog masla i ulja.</p>\n<!-- /wp:par