 i premažite preko vrelih mantija i ostavite 10 minuta poklopljeno drugom tepsijom da odstoji, pa poslužite posle 10 minuta.</p>\n<!-- /wp:paragraph -->','Mantije','','inherit','closed','closed','','258-revision-v1','','','2022-08-04 17:44:37','2022-08-04 17:44:37','',258,'https://afisic.wppsbootcamp.com/trpkovic/?p=260',0,'revision','',0),(261,1,'2022-08-04 17:48:33','2022-08-04 17:48:33','{\n    \"astra-settings[content-bg-obj-responsive]\": {\n        \"value\": {\n            \"desktop\": {\n                \"background-color\": \"var(--ast-global-color-5)\",\n                \"background-image\": \"\",\n                \"background-repeat\": \"repeat\",\n                \"background-position\": \"center center\",\n                \"background-size\": \"auto\",\n                \"background-attachment\": \"scroll\",\n                \"background-type\": \"color\",\n                \"background-media\": \"\"\n            },\n            \"tablet\": {\n                \"background-color\": \"var(--ast-global-color-5)\",\n                \"background-image\": \"\",\n                \"background-repeat\": \"repeat\",\n                \"background-position\": \"center center\",\n                \"background-size\": \"auto\",\n                \"background-attachment\": \"scroll\",\n                \"background-type\": \"color\",\n                \"background-media\": \"\"\n            },\n            \"mobile\": {\n                \"background-color\": \"var(--ast-global-color-5)\",\n                \"background-image\": \"\",\n                \"background-repeat\": \"repeat\",\n                \"background-position\": \"center center\",\n                \"background-size\": \"auto\",\n                \"background-attachment\": \"scroll\",\n                \"background-type\": \"color\",\n                \"background-media\": \"\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:48:31\"\