-275b5dd03fef','','','2022-08-04 17:50:16','2022-08-04 17:50:16','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=262',0,'customize_changeset','',0),(264,1,'2022-08-04 17:54:28','2022-08-04 17:54:28','{\n    \"astra-settings[related-posts-meta-structure]\": {\n        \"value\": [],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:54:28\"\n    }\n}','','','trash','closed','closed','','7a72fe0f-690b-4dac-9f24-69ef04376ccf','','','2022-08-04 17:54:28','2022-08-04 17:54:28','',0,'https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/7a72fe0f-690b-4dac-9f24-69ef04376ccf/',0,'customize_changeset','',0),(265,1,'2022-08-04 17:55:07','2022-08-04 17:55:07','{\"version\": 2, \"isGlobalStylesUserThemeJSON\": true }','Custom Styles','','publish','closed','closed','','wp-global-styles-astra-child','','','2022-08-04 17:55:07','2022-08-04 17:55:07','',0,'https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/wp-global-styles-astra-child/',0,'wp_global_styles','',0),(266,1,'2022-08-04 17:56:32','2022-08-04 17:56:32','<!-- wp:paragraph -->\n<p>Sama priprema testa je jednostavna i brza, ako ne računam vreme koje je potrebno da testo odstoji pre pečenja. Mere su: koliko sira, toliko brašna i margarina, a soli po ukusu. Iako retko koristim margarin, to radim u ovom slučaju. Jedino što možete uraditi je da dodate kašiku masti margarinu. Zašto? Nekako mi se čini da ni margarin nije kao što je nekad bio i da testo sa margarinom bude tvrdo i suvo. Pretpostavljam da je to zbog smanjene količine masnoće. Kako god, pravili pogačice po receptu ili nešto eksperimentisali, mere su sledeće:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>250 g brašna,</li><li>250 g sitnog sira,</li><li>250 g margarina (ili masti),</li><li>1 kašikica soli (ako je sir neslan, ako je slan, dovoljno je i 1/2 kašikice).</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Napomena: ako pravite za veće društvo, duplirajte ili utrostručite meru jer ove pogačice nestaju brzinom svetlosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U odgovarajuću posudu za mešenje, rukama izmrvite margarin u brašnu. Margarin se mora što bolje izmešati sa brašnom, ali nemojte da ga topite, jer ćete ga onda jako teško ravnomerno umešati. U to dodajte sitni, nemasni tzv. “švapski” sir. Sve zajedno dobro izmesite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U čemu je “kvaka” sa ovim receptom?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Važno je da ovo testo mora da odstoji najmanje jedan sat u frižideru, odnosno da se ohladi i stegne. Najbolje rezultate daje ako ga napravite dan ranije. Ako ih pečete odmah pogačice neće narasti. Možete da napravite i veću količinu testa, koju možete držati u zamrzivaču, a odmrzavati kasnije po potrebi, premesiti i praviti pogačice. Poenta je da testo treba malo da fermentiše kako bi bolje naraslo prilikom pečenja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Druga važna stvar je da ne dodajete ništa više od onog što sam napisala. Ako vam se učini da je testo suviše mekano i da se lepi – nema veze, kad odstoji i kad se ohladi moći ćete ga bolje umestiti, odn. premesiti. Zato ovo testo i treba praviti u nekoj posudi, a ne na dasci za mešenje. Ako dodate brašna više nego što treba, dobićete kamenčiće umesto pogačica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dobro rashlađeno testo razvijte na debljinu između 0,5 i 1 cm. Vadite pogačice čašicom ili modlom prečnika otprilike 2-3 cm, ne treba da budu velike. Pogačice ređajte u tepsiju. Od gore ih možete premazati umućenim jajetom i posuti mlevenim biberom, kimom, susamom… čime volite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tepsiju sa pogačicama stavite u zagrejanu rernu na 220ºC. Pecite ih dvadesetak minuta, odnosno dok lepo ne porumene.</p>\n<!-- /wp:paragraph -->','Pogačice sa sirom','','publish','closed','open','','pogacice-sa-sirom','','','2022-08-04 17:56:32','2022-08-04 17:56:32','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=266',0,'post','',0),(267,1,'2022-08-04 17:56:28','2022-08-04 17:56:28','','pogacice sa sirom','','inherit','','closed','','pogacice-sa-sirom','','','2022-08-04 17:56:28','2022-08-04 17:56:28','',266,'https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pogacice-sa-sirom.jpg',0,'attachment','image/jpeg',0),(268,1,'2022-08-04 17:56:32','2022-08-04 17:56:32','<!-- wp:paragraph -->\n<p>Sama priprema testa je jednostavna i brza, ako ne računam vreme koje je potrebno da testo odstoji pre pečenja. Mere su: koliko sira, toliko brašna i margarina, a soli po ukusu. Iako retko koristim margarin, to radim u ovom slučaju. Jedino što možete uraditi je da dodate kašiku masti margarinu. Zašto? Nekako mi se čini da ni margarin nije kao što je nekad bio i da testo sa margarinom bude tvrdo i suvo. Pretpostavljam da je to zbog smanjene količine masnoće. Kako god, pravili pogačice po receptu ili nešto eksperimentisali, mere su sledeće:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>250 g brašna,</li><li>250 g sitnog sira,</li><li>250 g margarina (ili masti),</li><li>1 kašikica soli (ako je sir neslan, ako je slan, dovoljno je i 1/2 kašikice).</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Napomena: ako pravite za veće društvo, duplirajte ili utrostručite meru jer ove pogačice nestaju brzinom svetlosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U odgovarajuću posudu za mešenje, rukama izmrvite margarin u brašnu. Margarin se mora što bolje izmešati sa brašnom, ali nemojte da ga topite, jer ćete ga onda jako teško ravnomerno umešati. U to dodajte sitni, nemasni tzv. “švapski” sir. Sve zajedno dobro izmesite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U čemu je “kvaka” sa ovim receptom?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Važno je da ovo testo mora da odstoji najmanje jedan sat u frižideru, odnosno da se ohladi i stegne. Najbolje rezultate daje ako ga napravite dan ranije. Ako ih pečete odmah pogačice neće narasti. Možete da napravite i veću količinu testa, koju možete držati u zamrzivaču, a odmrzavati kasnije po potrebi, premesiti i praviti pogačice. Poenta je da testo treba malo da fermentiše kako bi bolje naraslo prilikom pečenja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Druga važna stvar je da ne dodajete ništa više od onog što sam napisala. Ako vam se učini da je testo suviše mekano i da se lepi – nema veze, kad odstoji i kad se ohladi moći ćete ga bolje umestiti, odn. premesiti. Zato ovo testo i treba praviti u nekoj posudi, a ne na dasci za mešenje. Ako dodate brašna više nego što treba, dobićete kamenčiće umesto pogačica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dobro rashlađeno testo razvijte na debljinu između 0,5 i 1 cm. Vadite pogačice čašicom ili modlom prečnika otprilike 2-3 cm, ne treba da budu velike. Pogačice ređajte u tepsiju. Od gore ih možete premazati umućenim jajetom i posuti mlevenim biberom, kimom, susamom… čime volite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tepsiju sa pogačicama stavite u zagrejanu rernu na 220ºC. Pecite ih dvadesetak minuta, odnosno dok lepo ne porumene.</p>\n<!-- /wp:paragraph -->','Pogačice sa sirom','','inherit','closed','closed','','266-revision-v1','','','2022-08-04 17:56:32','2022-08-04 17:56:32','',266,'https://afisic.wppsbootcamp.com/trpkovic/?p=268',0,'revision','',0),(270,1,'2022-08-04 17:59:01','2022-08-04 17:59:01','<article data-id=\"266\">\n            <a href=\"https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/pogacice-sa-sirom/\"></a>\n                <img width=\"300\" height=\"200\" src=\"https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pogacice-sa-sirom-300x200.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pogacice-sa-sirom-300x200.jpg 300w, https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pogacice-