psbootcamp.com/trpkovic/wp-content/uploads/2022/08/mantije-300x204.webp 300w, https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/mantije-768x521.webp 768w, https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/mantije.webp 800w\" sizes=\"(max-width: 300px) 100vw, 300px\">\n\n<header>\n<h2><a href=\"https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/mantije/\" title=\"Mantije\">Mantije</a></h2>\n</header>\n</article>\n<article data-id=\"251\">\n            <a href=\"https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/burek-sa-mesom/\"></a>\n<img width=\"300\" height=\"225\" src=\"https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek-sa-mesom-300x225.webp\" alt=\"\" loading=\"lazy\" srcset=\"https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek-sa-mesom-300x225.webp 300w, https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek-sa-mesom-768x576.webp 768w, https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek-sa-mesom.webp 1024w\" sizes=\"(max-width: 300px) 100vw, 300px\">\n\n<header>\n<h2><a href=\"https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/burek-sa-mesom/\" title=\"Burek sa mesom\">Burek sa mesom</a></h2>\n</header>\n</article>','Vesti','','inherit','closed','closed','','281-revision-v1','','','2022-08-04 18:06:50','2022-08-04 18:06:50','',281,'https://afisic.wppsbootcamp.com/trpkovic/?p=282',0,'revision','',0),(283,1,'2022-08-04 18:08:06','2022-08-04 18:08:06','<!-- wp:paragraph -->\n<p>Nakon velikog broja poruka sa željom da se otvori lokacija na Novom Beogradu, rukovodstvo pekare ‘Trpković’ odlučilo je da proširi poslovanje i trenutno razmatra objekte u okolini Fontane koje bi mogle da udostoje naše proizvode od testa, naširoko poznate.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pratite nas za još informacija!</p>\n<!-- /wp:paragraph -->','Uskoro lokacija na Novom Beogradu!','','publish','closed','open','','uskoro-lokacija-na-novom-beogradu','','','2022-08-04 18:08:06','2022-08-04 18:08:06','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=283',0,'post','',0),(284,1,'2022-08-04 18:08:00','2022-08-04 18:08:00','','nbg','','inherit','','closed','','nbg','','','2022-08-04 18:08:00','2022-08-04 18:08:00','',283,'https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/nbg.jpg',0,'attachment','image/jpeg',0),(285,1,'2022-08-04 18:08:06','2022-08-04 18:08:06','<!-- wp:paragraph -->\n<p>Nakon velikog broja poruka sa željom da se otvori lokacija na Novom Beogradu, rukovodstvo pekare ‘Trpković’ odlučilo je da proširi poslovanje i trenutno razmatra objekte u okolini Fontane koje bi mogle da udostoje naše proizvode od testa, naširoko poznate.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pratite nas za još informacija!</p>\n<!-- /wp:paragraph -->','Uskoro lokacija na Novom Beogradu!','','inherit','closed','closed','','283-revision-v1','','','2022-08-04 18:08:06','2022-08-04 18:08:06','',283,'https://afisic.wppsbootcamp.com/trpkovic/?p=285',0,'revision','',0),(286,1,'2022-08-04 18:07:44','2022-08-04 18:07:44','<!-- wp:paragraph -->\n<p>Pre nekoliko dana, u jeku pandemije i ekonomskih potresa, pažnju je privukla jedna pekara iz Pančeva, čija je vlasnica pronašla način da održi poslovanje, na zadovoljstvo i kupaca i zaposlenih.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U trenu je osvanula vest o sada već čuvenom burekomatu, ali kada smo kontaktirali vlasnicu pekare “Burek Stankoski”, odmah nas je ispravila rekavši da nije reč o klasičnom automatu, već o šalteru. Ideja je, naravno, da se eliminiše gužva u objektu, i da se sama prodaja odvija bezbednije i brže.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Snalažljiv kolektiv je brzo osposobio šalter za rad, koji funkcioniše tako što se kroz gornji otvor daje novac, a kroz donji otvor – hrana. Prodavci nose rukavice i maske sve vreme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Inače, pekara “Burek Stankoski” je odavno poznata po dobrom bureku, ovde su svraćali mnogi poznati, a čak i sada u vreme krize – imaju mušterije iz okolnih mesta i gradova. Jedan Zemunac kaže da u Pančevo samo zbog bureka dolazi već peti put, a ima i Beograđana.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O tome da se ideja veoma dopada svima, najbolje svedoči red ispred pekare. Kupci su oduševljeni. Poštuju i pravilo o držanju distance u redu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U ponudi su šest slanih i dva slatka bureka, a najpopularniji je onaj s kolenicom. Vlasnica pekare, Svetlana Radaković, kaže za Telegraf Biznis da će šalter biti u funkciji sve dok traje pandemija, a onda će ga ukloniti, iako primećuje da se mnogima ovakav vid usluge dopada.</p>\n<!-- /wp:paragraph -->','Burek sa kolenicom?','','publish','closed','open','','burek-sa-kolenicom','','','2022-08-04 18:33:22','2022-08-04 18:33:22','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=286',0,'post','',0),(287,1,'2022-08-04 18:08:40','2022-08-04 18:08:40','','stankoski','','inherit','','closed','','stankoski','','','2022-08-04 18:08:40','2022-08-04 18:08:40','',286,'https://afisic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/stankoski.jpg',0,'attachment','image/jpeg',0),(288,1,'2022-08-04 18:08:44','2022-08-04 18:08:44','<!-- wp:paragraph -->\n<p>Pre nekoliko dana, u jeku pandemije i ekonomskih potresa, pažnju je privukla jedna pekara iz Pančeva, čija je vlasnica pronašla način da održi poslovanje, na zadovoljstvo i kupaca i zaposlenih.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U trenu je osvanula vest o sada već čuvenom burekomatu, ali kada smo kontaktirali vlasnicu pekare “Burek Stankoski”, odmah nas je ispravila rekavši da nije reč o klasičnom automatu, već o šalteru. Ideja je, naravno, da se eliminiše gužva u objektu, i da se sama prodaja odvija bezbednije i brže.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Snalažljiv kolektiv je brzo osposobio šalter za rad, koji funkcioniše tako što se kroz gornji otvor daje novac, a kroz donji otvor – hrana. Prodavci nose rukavice i maske sve vreme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Inače, pekara “Burek Stankoski” je odavno poznata po dobrom bureku, ovde su svraćali mnogi poznati, a čak i sada u vreme krize – imaju mušterije iz okolnih mesta i gradova. Jedan Zemunac kaže da u Pančevo samo zbog bureka dolazi već peti put, a ima i Beograđana.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O tome da se ideja veoma dopada svima, najbolje svedoči red ispred pekare. Kupci su oduševljeni. Poštuju i pravilo o držanju distance u redu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U ponudi su šest slanih i dva slatka bureka, a najpopularniji je onaj s kolenicom. Vlasnica pekare, Svetlana Radaković, kaže za Telegraf Biznis da će šalter biti u funkciji sve dok traje pandemija, a onda će ga ukloniti, iako primećuje da se mnogima ovakav vid usluge dopada.</p>\n<!-- /wp:paragraph -->','Burek sa kolenicom?','','inherit','closed','closed','','286-revision-v1','','','2022-08-04 18:08:44','2022-08-04 18:08:44','',286,'https://afisic.wppsbootcamp.com/trpkovic/?p=288',0,'revision','',0),(289,1,'2022-08-04 18:09:07','2022-08-04 18:09:07',' ','','','publish','closed','closed','','289','','','2022-08-04 18:09:07','2022-08-04 18:09:07','',0,'https://afisic.wppsbootcamp.com/trpkovic/?p=289',6,'nav_menu_item','',0),(290,1,'2022-08-04 18:09:14','2022-08-04 18:09:14','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2022-08-04 18:09:14','2022-08-04 18:09:14','',1,'https://afisic.wppsbootcamp.com/trpkovic/?p=290',0,'revision','',0),(291,1,'2022-08-04 18:10:24','2022-08-04 18:10:24','<article data-id=\"266\">\n            <a href=\"https://afisic.wppsbootcamp.com/trpkovic/2022/08/04/pogacice-sa-sirom/\